        new_addr_str = f"0x{max(0, new_val):08x}"
        
        # ðŸ”§ KEEPING THE NOTES EXACTLY AS THEY ARE
        # We ensure the internal \r\n are preserved as literal text
        flat_text = rest_of_text.replace('\r', '').replace('\n', r'\r\n')
        
